import { StyleSheet } from "react-native";

const login_styles =StyleSheet.create({

    container: {
        width: '100vw',
        height: '100vh',

        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',

        border: '4px solid black',
    },

    login_container: {
        width: '100vw',
        height: '100vh',

        alignItems: 'center',
        justifyContent: 'center',

        border: '4px solid black'
        

    }

});

export {login_styles};
